static void test_read_S19(void)
{
	unsigned int result;

	size_t address_offset = 0;
	size_t address[100000];
	uint8_t data[100000];
	size_t data_len = 100000;

	result = read_s19_file("test/data/test_s19.s19", address_offset, data, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_OK);
	CU_ASSERT(memcmp(data, read_s19_test_data, data_len) == 0 );
	for(unsigned int i = 0; i < data_len; i++){
		if(address[i] != 0x10000000 + i){
			CU_FAIL("Address check");
		}
	}

}


static void test_read_S19_bad(void)
{
	unsigned int result;

	size_t address_offset = 0;
	size_t address[500];
	uint8_t data[500];
	size_t data_len = 500;

	result = read_s19_file("test/data/test_s19_bad.s19", address_offset, data, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_BAD_FORMAT);

	result = read_s19_file(NULL, address_offset, data, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_BAD_PARAMETER);

	result = read_s19_file("test/data/test_s19_bad.s19", address_offset, NULL, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_NULL_POINTER);

	result = read_s19_file("test/data/test_s19_bad.s19", address_offset, data, NULL, address);
	CU_ASSERT_EQUAL(result, ERR_NULL_POINTER);

	result = read_s19_file("test/data/test_s19_bad.s19", address_offset, data, &data_len, NULL);
	CU_ASSERT_EQUAL(result, ERR_NULL_POINTER);

	result = read_s19_file("test/data/test_s19_bad_2.s19", address_offset, data, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_BAD_FORMAT);

	data_len = 10;
	result = read_s19_file("test/data/test_s19_bad_2.s19", address_offset, data, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_FILE_TOO_LONG);
}



static void test_read_S19_empty(void)
{
	unsigned int result;

	size_t address_offset = 0;
	size_t address[10];
	uint8_t data[10];
	size_t data_len = 10;

	result = read_s19_file("test/data/test_s19_empty.s19", address_offset, data, &data_len, address);
	CU_ASSERT_EQUAL(result, ERR_FILE_ERROR);
}

static void test_read_S19_nofile(void)
{
	unsigned int result;

	size_t address_offset = 0;
	size_t address[10];
	uint8_t data[10];
	size_t data_len = 10;

	result = read_s19_file("test/data/s19_do_not_exist.s19", address_offset, data, &data_len, address);

	CU_ASSERT_EQUAL(result, ENOENT);
}

static void test_get_addr_S19(void)
{
	unsigned int result;

	size_t start_addr;
	size_t end_addr;

	result = get_start_addr_and_length_s19("test/data/test_s19.s19", &start_addr, &end_addr);
	CU_ASSERT_EQUAL(result, ERR_OK);
	CU_ASSERT_EQUAL(start_addr, 0x10000000);
	CU_ASSERT_EQUAL(end_addr, 0x10004A00);

	result = get_start_addr_and_length_s19("test/data/test_s19_bad.s19", &start_addr, &end_addr);
	CU_ASSERT_EQUAL(result, ERR_BAD_FORMAT);

	result = get_start_addr_and_length_s19(NULL, &start_addr, &end_addr);
	CU_ASSERT_EQUAL(result, ERR_BAD_PARAMETER);

	result = get_start_addr_and_length_s19("test/data/test_s19_bad.s19", NULL, &end_addr);
	CU_ASSERT_EQUAL(result, ERR_NULL_POINTER);

	result = get_start_addr_and_length_s19("test/data/test_s19_bad.s19", &start_addr, NULL);
	CU_ASSERT_EQUAL(result, ERR_NULL_POINTER);

	result = get_start_addr_and_length_s19("test/data/test_s19_empty.s19", &start_addr, &end_addr);
	CU_ASSERT_EQUAL(result, ERR_FILE_ERROR);

	result = get_start_addr_and_length_s19("test/data/s19_do_not_exist.s19", &start_addr, &end_addr);
	CU_ASSERT_EQUAL(result, ENOENT);
}

static void test_extension(void)
{

	CU_ASSERT_TRUE(extension("s19", "filename.s19"));
	CU_ASSERT_TRUE(extension("S19", "filename.s19"));
	CU_ASSERT_TRUE(extension("s19", "filename.S19"));
	CU_ASSERT_TRUE(extension("sbin", "filename.sbin"));
	CU_ASSERT_FALSE(extension("s194", "filename.s19"));
	CU_ASSERT_FALSE(extension("s19", "filename.s19A"));
	CU_ASSERT_FALSE(extension("sbin", "filename.s19"));
	CU_ASSERT_TRUE(extension("s19", "filename.s19 "));

}

static CU_TestInfo tests_readfile[] = {
  { "test of S19 file parsing", test_read_S19 },
  { "test of S19 file parsing Bad", test_read_S19_bad },
  { "test of S19 file parsing Empty", test_read_S19_empty },
  { "test of S19 file parsing No File", test_read_S19_nofile },
  { "test of S19 get addr", test_get_addr_S19 },
  { "test of extension", test_extension },
	CU_TEST_INFO_NULL,
};

static CU_SuiteInfo suites [] = { { "Read File", init_suite1, clean_suite1, setup_suite1, teardown_suite1, tests_readfile },
		CU_SUITE_INFO_NULL,
	};


/* The main() function for setting up and running the tests.
 * Returns a CUE_SUCCESS on successful running, another
 * CUnit error code on failure.
 */
int TS_ReadFile(void)
{
   if (0 !=  CU_register_suites(suites)){
	   CU_cleanup_registry();
	   return CU_get_error();
   }

   return ERR_OK;
}
